import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the "Sort and Filter Controls" container
    // Use a unique label text for the sort select, then find the view toggle buttons nearby
    await page.waitForSelector('label[for="sortSelect"]', { timeout: 5000 });

    // Find the "List View" button using its title attribute
    const listViewBtn = await page.$('button[title="List View"]');
    if (!listViewBtn) {
      throw new Error('List View button not found');
    }

    // Take screenshot before clicking
    const beforeClickShot = path.join(screenshotsDir, 'step_2_before_list_view_click.png');
    await page.screenshot({ path: beforeClickShot });
    screenshots.push(beforeClickShot);

    // Click the List View button
    await listViewBtn.click();

    // Wait for the products container to switch to list view (class "products-list" should appear)
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Take screenshot after switching view
    const afterClickShot = path.join(screenshotsDir, 'step_3_after_list_view_click.png');
    await page.screenshot({ path: afterClickShot });
    screenshots.push(afterClickShot);

    // Extract verification data: check that at least one product card in list view exists
    const listCards = await page.$$eval('.products-list .product-card-list', els => els.length);

    return {
      success: true,
      action: "Switched to List View Mode using the List View toggle button",
      extractedData: {
        listViewProductCardsCount: listCards
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
